import math

def is_prime(n):
    if n == 1:
        return False
    elif n == 2:
        return True
    elif n % 2 == 0:
        return False
    else:
        for i in range(3, int(math.sqrt(n)) + 1, 2):
            if n % i == 0:
                return False
    return True

def get_primes(n):
    primes = []
    for i in range(2, n + 1):
        if is_prime(i):
            primes.append(i)
    return primes

def get_prime_factors(n):
    factors = []
    for i in get_primes(int(math.sqrt(n)) + 1):
        if n % i == 0:
            factors.append(i)
    return factors

def get_prime_factors_count(n):
    factors = get_prime_factors(n)
    count = 0
    for i in factors:
        count += n // i
    return count

def get_prime_factors_sum(n):
    factors = get_prime_factors(n)
    sum = 0
    for i in factors:
        sum += i
    return sum

def get_prime_factors_sum_of_count(n):
    factors = get_prime_factors(n)
    sum = 0
    for i in factors:
        sum += get_prime_factors_count(i)
    return sum

def get_prime_factors_sum_of_count_and_sum(n):
    factors = get_prime_factors(n)
    sum = 0
    for i in factors:
        sum += get_prime_factors_count(i) * i
    return sum

